import React from 'react';
import './Proposals.css';

const Proposals = () => {
  const proposals = [
    {
      id: 1,
      title: 'Educación de Calidad',
      icon: 'fas fa-graduation-cap',
      description: 'Implementación de un sistema educativo integral que garantice el acceso a una educación de calidad para todos los bolivianos, con énfasis en la formación técnica y tecnológica.'
    },
    {
      id: 2,
      title: 'Salud Pública',
      icon: 'fas fa-heartbeat',
      description: 'Mejora de la infraestructura hospitalaria y acceso a medicamentos esenciales para todos los ciudadanos, con especial atención a las zonas rurales.'
    },
    {
      id: 3,
      title: 'Seguridad Ciudadana',
      icon: 'fas fa-shield-alt',
      description: 'Políticas integrales de seguridad ciudadana que combatan la delincuencia y promuevan la convivencia pacífica en nuestras comunidades.'
    },
    {
      id: 4,
      title: 'Desarrollo Económico',
      icon: 'fas fa-chart-line',
      description: 'Fomento a la inversión privada, generación de empleo y apoyo a las pequeñas y medianas empresas como motores del desarrollo económico nacional.'
    },
    {
      id: 5,
      title: 'Medio Ambiente',
      icon: 'fas fa-leaf',
      description: 'Políticas sostenibles que protejan nuestros recursos naturales y promuevan el desarrollo sostenible para las futuras generaciones.'
    },
    {
      id: 6,
      title: 'Transparencia',
      icon: 'fas fa-hand-holding-heart',
      description: 'Gobierno abierto y transparente, con rendición de cuentas claras y participación ciudadana en la toma de decisiones.'
    }
  ];

  return (
    <section className="proposals-section">
      <div className="container">
        <h2 className="section-title">Nuestras Propuestas</h2>
        <p className="section-subtitle">Trabajando por un futuro mejor para todos los bolivianos</p>

        <div className="proposals-grid">
          {proposals.map((proposal) => (
            <div key={proposal.id} className="proposal-card">
              <div className="proposal-icon">
                <i className={proposal.icon}></i>
              </div>
              <h3>{proposal.title}</h3>
              <p>{proposal.description}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Proposals;
